import React from 'react'
import { useSelector } from 'react-redux'

import styles from './StatusStatistics.modules.css'

export const StatusStatistics = () => {
  const statusCount = useSelector((state) => state.createTask.statusCount)

  return (
    <div className={styles.StatusStatisticsWrap}>
      <div className={styles.StatusStatisticsItem}>a {statusCount['active']}</div>
      <div className={styles.StatusStatisticsItem}>ip {statusCount['inprogress']}</div>
      <div className={styles.StatusStatisticsItem}>a {statusCount['urgent']}</div>
    </div>
  )
}
